import { ReactComponent as Star } from "../images/star.svg";
import times from "lodash/times";

const Language = ({ language }) => {
    const [hasLoaded, setHasLoaded] = useState(false);

    useEffect(() => {
      setHasLoaded(true);
    }, []);

    return (
        <div>
      <Star className="star"></Star>
      <Star className="star"></Star>
      </div>
    );
}

export default Language;
